
import tkinter as tk
from PIL import Image, ImageTk, ImageSequence
import io
import base64

# Вграден GIF файл, кодиран в base64
gif_base64 = """"""

class SalamApp:
    def __init__(self, root):
        self.root = root
        self.root.title("Салам Навсякъде")
        self.root.geometry("800x600")
        self.root.configure(bg="white")

        self.bg_text = tk.Label(
            root,
            text="салам " * 500,
            fg="#bbbbbb",
            bg="white",
            font=("Arial", 12),
            wraplength=2000,
            justify="left"
        )
        self.bg_text.place(x=-200, y=-200)

        self.gif_label = tk.Label(root, bd=5, relief="solid", highlightbackground="yellow")
        self.gif_label.place(relx=0.5, rely=0.5, anchor="center")

        self.load_gif()

    def load_gif(self):
        gif_bytes = base64.b64decode(gif_base64)
        gif_stream = io.BytesIO(gif_bytes)
        self.gif = Image.open(gif_stream)
        self.frames = [ImageTk.PhotoImage(frame.copy().convert("RGBA")) for frame in ImageSequence.Iterator(self.gif)]
        self.frame_index = 0
        self.animate()

    def animate(self):
        self.gif_label.configure(image=self.frames[self.frame_index])
        self.frame_index = (self.frame_index + 1) % len(self.frames)
        self.root.after(100, self.animate)

if __name__ == "__main__":
    root = tk.Tk()
    app = SalamApp(root)
    root.mainloop()
